            id: 0,
            todo: '',
            completed: false,
            userId:0,
        }
        newToDo.todo = todo;
        newToDo.userId = u.userId;
        console.log(newToDo.todo);
        // recorrer los todos del user para saber que id le corresponde a este todo 
        // agregar a la lista de todos este nuevo todo
