    }

    return (
        <div className='body'>
            <div className='boxOne'>
                <h1>
                    Profile : {u.firstName} {u.lastName}
                </h1>
                <button> TIMELINE </button>
                <button> LOG IN/ OUT </button>
            </div>

            <div className="boxTwo">
                {/* <ToDoForm addToDo={addToDo}></ToDoForm> */}
                <ToDosUser usuario={u} ></ToDosUser>
            </div> 
        </div>
    );
}
